import axios from 'axios';
import React, { useEffect, useState } from 'react';

const Messages = () => {

    const [allMessages, setAllMessages] = useState([]);

    useEffect(async () => {

        const response = await axios.get("http://localhost:8010/channels/messages/60f8bfb41fd542bd56c8852f")

        console.log("messages response", response);

        setAllMessages(response.data)

    }, []);


    return (
        <div>
            {console.log("state messages; ", allMessages)}
            <ul class="list-group list-group-flush">
                {allMessages.map((elem) =>
                    <li class="list-group-item text-end">{elem.message}</li>
                )}
                <li class="list-group-item text-end">A second item
                    <div class="d-flex w-100 ">
                        <b><p class="mb-1 me-1 text-end">List group item heading</p></b>
                        <small className="text-end">22:17</small>
                    </div>
                    <p class="mb-1">Some placeholder content in a paragraph.</p>
                </li>
            </ul>
        </div>
    );
}

export default Messages;
